server_modules:
- {name: SaveAndSendEmail, code: "import anvil.email\nimport anvil.tables as tables\n\
    import anvil.tables.query as q\nfrom anvil.tables import app_tables\nimport anvil.server\n\
    from datetime import datetime\n\n@anvil.server.callable\ndef add_feedback(name,\
    \ email, feedback):\n  # This function is called from HomeForm when the user clicks\
    \ \"SUBMIT\".\n\n  # We use Anvil's built-in Data Tables to save the feedback.\n\
    \  # You can find your Data Tables in the navigation on the left.\n  app_tables.feedback.add_row(\n\
    \      name=name,\n      email=email,\n      feedback=feedback,\n      created=datetime.now()\n\
    \  )\n\n  # Now we send an email to you, the app's author!\n  anvil.email.send(#to=\"\
    somebody@example.com\", # Change this to your email address\n                \
    \  subject=\"Feedback from {}\".format(name),\n                  text=\"\"\"\n\
    \  A new person has filled out the feedback form!\n\n  Name: {}\n  Email address:\
    \ {}\n  Feedback:\n  {}\n  \"\"\".format(name, email, feedback))\n\n  # Pretty\
    \ simple, huh?\n  # To learn more about Anvil, go to:\n  # https://anvil.works/learn/tutorials\n",
  id: K3BJP54LLIFUNBZKPJQNF3SQ3PXH3K3L}
